INSERT INTO `pages` (`id`, `url`, `title`, `content`, `locale`, `status`, `created_at`, `updated_at`) VALUES
(1, 'privacy', 'Privacy Policy', '<p>We, at Ganzberg, care deeply about privacy. We believe in transparency, and we\'re committed to being upfront about our privacy practices, including how we treat your personal information. We know you care about your privacy too, so we provide settings that allow you to choose how certain information is used by Ganzberg. This policy explains our privacy practices for store.ganzberg.com and our other services provided by Ganzberg (we\'ll refer to store.ganzberg.com collectively as the \"Site\" and our other services as the \"Services.\").</p>\r\n<h3>COLLECTION OF INFORMATION</h3>\r\n\r\n<p>To use the Services, you will need to provide valid phone number and email address. Depending on the Services that you choose to use, we may collect additional information, for example: information in private channels like conversations, a telephone number, and a physical address. Please note that for security and performance reasons, such content may need to be accessed by certain Ganzberg personnel from time to time.</p>\r\n\r\n<p>The name associated with your Ganzberg account is publicly displayed and connected to your Ganzberg activities. You may review and change that name through your account settings. Other people may see the date you joined; ratings, reviews and related photos for items you purchased or sold; your profile information; items you listed for sale; your store pages and policies; your favorites, followers and those you follow; sold item listings and the number of items sold; and comments you post in our community spaces. You may optionally choose to provide and publicly display your full name and other personal information (such as birthday, gender, and location).</p>\r\n\r\n<p>You may connect to the Services with an external application, in which case Ganzberg may receive information from that other service, as explained below. We use technologies such as cookies, clear gifs, and log files for several purposes, including to help understand how you interact with the Site and the Services, in order to provide a better experience, and for marketing and advertising. For more information about cookies, mobile analytics, and similar technologies.</p>\r\n\r\n<p>Ganzberg and its partners use cookies or similar technologies to analyze trends, administer the Services, track users\' movements around the Site, including across devices, and to gather demographic information about our user base as a whole. You can control the use of cookies at the individual browser level, but if you choose to disable cookies, it may limit your use of certain features or functions on the Site or through the Services.</p>\r\n\r\n<h3>USES AND SHARING</h3>\r\n\r\n<p>We use the information that we gather from you in a number of ways. For example, if you purchase an item, we\'ll share your delivery information with the seller; we use data analytics and work with certain third-party service providers to ensure site functionality, to improve the Services, and for targeted online and offline advertising and marketing; and of course, we use your phone or email address to communicate with you. We also partner with service providers and other third parties that collect, use, promote, and analyze information about Ganzberg members and visitors.</p>\r\n\r\n<p>Ganzberg will not sell or disclose your personal information to third parties without your consent, except as specified in our Privacy Policy.</p>\r\n\r\n<h3>CHOICES AND CONTROL</h3>\r\n\r\n<p>You may review and change your information in your account settings, and you may remove certain optional pieces of information. You may also control the receipt of certain types of communications from Ganzberg in your account settings. We partner with third parties to manage our advertising on other sites. Our third-party partners may use cookies or similar technologies in order to provide you with advertising based upon your browsing activities and interests.</p>\r\n\r\n<h3>COOKIES</h3>\r\n<p>Generally, we use cookies to identify you and enable us to (i) access your Registration Information or Account Information so you do not have to re-enter it; (ii) gather statistical information about usage by users; (iii) research visiting patterns and help target advertisements based on user interests; (iv) assist our partners to track user visits to the Sites and process orders; and (v) track progress and participation in promotions.</p>\r\n\r\n<p>You can determine if and how a cookie will be accepted by configuring the browser which is installed in the computer or smart phone you are using to access the Sites. If you choose, you can change those configurations. By setting your preferences in the browser, you can accept all cookies or you can choose to be notified when a cookie is sent or you can choose to reject all cookies. If you reject all cookies by choosing the cookie-disabling function in your browser, you may be required to re-enter information on the Sites more often and certain features of the Sites may be unavailable.</p>\r\n\r\n<h3>CHANGES TO THIS PRIVACY POLICY</h3>\r\n\r\n<p>Any changes to this Privacy Policy will be communicated by us posting an amended and restated Privacy Policy on the Sites. Once posted on the Sites the new Privacy Policy will be effective immediately. You agree that any information we hold about you (as described in this Privacy Policy and whether or not collected prior to or after the new Privacy Policy became effective) will be governed by the latest version of the Privacy Policy.</p>', 'en', 1, NULL, NULL),
(2, 'privacy', 'គោលការណ៍ភាពឯកជន', '<h1>គោលការណ៍ភាពឯកជន</h1>\r\n<p>We, at Ganzberg, care deeply about privacy. We believe in transparency, and we\'re committed to being upfront about our privacy practices, including how we treat your personal information. We know you care about your privacy too, so we provide settings that allow you to choose how certain information is used by Ganzberg. This policy explains our privacy practices for store.ganzberg.com and our other services provided by Ganzberg (we\'ll refer to store.ganzberg.com collectively as the \"Site\" and our other services as the \"Services.\").</p>\r\n<h3>COLLECTION OF INFORMATION</h3>\r\n\r\n<p>To use the Services, you will need to provide valid phone number and email address. Depending on the Services that you choose to use, we may collect additional information, for example: information in private channels like conversations, a telephone number, and a physical address. Please note that for security and performance reasons, such content may need to be accessed by certain Ganzberg personnel from time to time.</p>\r\n\r\n<p>The name associated with your Ganzberg account is publicly displayed and connected to your Ganzberg activities. You may review and change that name through your account settings. Other people may see the date you joined; ratings, reviews and related photos for items you purchased or sold; your profile information; items you listed for sale; your store pages and policies; your favorites, followers and those you follow; sold item listings and the number of items sold; and comments you post in our community spaces. You may optionally choose to provide and publicly display your full name and other personal information (such as birthday, gender, and location).</p>\r\n\r\n<p>You may connect to the Services with an external application, in which case Ganzberg may receive information from that other service, as explained below. We use technologies such as cookies, clear gifs, and log files for several purposes, including to help understand how you interact with the Site and the Services, in order to provide a better experience, and for marketing and advertising. For more information about cookies, mobile analytics, and similar technologies.</p>\r\n\r\n<p>Ganzberg and its partners use cookies or similar technologies to analyze trends, administer the Services, track users\' movements around the Site, including across devices, and to gather demographic information about our user base as a whole. You can control the use of cookies at the individual browser level, but if you choose to disable cookies, it may limit your use of certain features or functions on the Site or through the Services.</p>\r\n\r\n<h3>USES AND SHARING</h3>\r\n\r\n<p>We use the information that we gather from you in a number of ways. For example, if you purchase an item, we\'ll share your delivery information with the seller; we use data analytics and work with certain third-party service providers to ensure site functionality, to improve the Services, and for targeted online and offline advertising and marketing; and of course, we use your phone or email address to communicate with you. We also partner with service providers and other third parties that collect, use, promote, and analyze information about Ganzberg members and visitors.</p>\r\n\r\n<p>Ganzberg will not sell or disclose your personal information to third parties without your consent, except as specified in our Privacy Policy.</p>\r\n\r\n<h3>CHOICES AND CONTROL</h3>\r\n\r\n<p>You may review and change your information in your account settings, and you may remove certain optional pieces of information. You may also control the receipt of certain types of communications from Ganzberg in your account settings. We partner with third parties to manage our advertising on other sites. Our third-party partners may use cookies or similar technologies in order to provide you with advertising based upon your browsing activities and interests.</p>\r\n\r\n<h3>COOKIES</h3>\r\n<p>Generally, we use cookies to identify you and enable us to (i) access your Registration Information or Account Information so you do not have to re-enter it; (ii) gather statistical information about usage by users; (iii) research visiting patterns and help target advertisements based on user interests; (iv) assist our partners to track user visits to the Sites and process orders; and (v) track progress and participation in promotions.</p>\r\n\r\n<p>You can determine if and how a cookie will be accepted by configuring the browser which is installed in the computer or smart phone you are using to access the Sites. If you choose, you can change those configurations. By setting your preferences in the browser, you can accept all cookies or you can choose to be notified when a cookie is sent or you can choose to reject all cookies. If you reject all cookies by choosing the cookie-disabling function in your browser, you may be required to re-enter information on the Sites more often and certain features of the Sites may be unavailable.</p>\r\n\r\n<h3>CHANGES TO THIS PRIVACY POLICY</h3>\r\n\r\n<p>Any changes to this Privacy Policy will be communicated by us posting an amended and restated Privacy Policy on the Sites. Once posted on the Sites the new Privacy Policy will be effective immediately. You agree that any information we hold about you (as described in this Privacy Policy and whether or not collected prior to or after the new Privacy Policy became effective) will be governed by the latest version of the Privacy Policy.</p>', 'km', 1, NULL, NULL),
(3, 'terms', 'Terms of Use', '<p>Welcome to Ganzberg Online Store! These Terms of Use describe the terms and conditions applicable to your access and use of the websites at <a href=\"https://store.ganzberg.com/\" target=\"_blank\">store.ganzberg.com</a> (a \"Site\", \"Sites\"). This document is a legally binding agreement between you as the user(s) of the Sites (referred to as \"you\", \"your\" or \"User\" hereinafter) and store.ganzberg.com (referred to as \"we\", \"our\", \"Ganzberg Shop\", or \"store.ganzberg.com\" hereinafter).</p>\r\n\r\n<h3>ACCESS AND USE OF THE WEBSITE</h3>\r\n\r\n<p>Your use of the Sites and store.ganzberg.com\'s services, software and products (collectively as the \"Services\" hereinafter) is subject to the terms of use contained in this document as well as the Privacy Policy, the Product Listing Policy and any other rules and policies of the Sites that store.ganzberg.com may publish from time to time. The promotion services referred to in the store.ganzberg.com free membership agreement shall include top ranking and sponsored Listing and any such other Services as may be announced by store.ganzberg.com from time to time. This document and such other rules and policies of the Sites are collectively referred to below as the \"Terms\". By accessing the Sites or using the Services, you agree to accept and be bound by the Terms. Please do not use the Services or the Sites if you do not accept all of the Terms.</p>\r\n\r\n<p>In order to use the services on our Website, you must be at least 18 years of age. The services are not intended for the users under the Mininum Age of 18 years old. You must be a registered member to make orders and access some features of the Website. You will provide us with personal information including your name, address, phone number, and a valid email address. You must ensure this information is accurate and current.</p>\r\n\r\n<p>We may refer fraudulent or abusive or illegal activity to the relevant authorities. You are solely responsible for the activity that occurs on your account (including orders placed using your account), and you must keep your account password secure. We are not responsible for any unauthorized activity on your account if you fail to keep your account login information secure.</p>\r\n\r\n<p>You must not use another member\'s account without our, and/or the other user\'s, express permission. If you suspect or become aware of any unauthorized use of your account or that your password is no longer secure, you must notify us immediately and take immediate steps to re-secure your account (including by changing your password).</p>\r\n\r\n<p>We do not warrant that the Website will be available at all times and without disruption and we provide no warranties in relation to the content of any other website linked to or from our Website.</p>\r\n\r\n<h3>PRIVACY</h3>\r\n\r\n<p>Ganzberg\'s privacy policy explains the data we collect, use, store, and process while you use and access our Services. By using our Services, you have read, understood, and agree to the terms of our privacy policy, and you agree that we may use such data in accordance with the terms of our privacy policy. If you have any questions regarding our privacy policy, please contact us.</p>\r\n\r\n<h3>RESPONSIBILITY</h3>\r\n\r\n<p>You are responsible for all information (including contact and payment information) in your account is always available and the data is correct. Notify Us of any changes or issues with your order within a certain period of time.</p>\r\n\r\n<p>Ganzberg is not responsible for the content of a package delivered by the seller to the buyer. A customer accepts the use of this system at their own risk. The risk of decay or damaging the objects during transport is taken by the organization transporting the object, i.e. a courier service or the seller himself/herself if he/she makes a commitment after the offer to deliver the product has been accepted.</p>\r\n\r\n<h3>PURCHASE AND CHANGE PROVISIONS</h3>\r\n\r\n<p>Orders or Reservations can be changed when the user performs an order check on their shopping cart. Order can not be changed if the user has already made a payment.</p>\r\n\r\n<p>The user will get the order on the chosen date at the indicated timeframe of the delivery. Each product\'s storage instructions will appear on the packaging.</p>\r\n\r\n<h3>PRODUCT DESCRIPTION AND INFORMATION</h3>\r\n\r\n<p>We always try to include the latest product images in each list of products offered. However, product details may change from time to time and there is a delay in updating our website. We recommend that you read the product details carefully on the packaging labels that we ship before you consume your order from our website. The contents of the packaging may vary from time to time.</p>\r\n\r\n<h3>DELIVERY PROVISIONS</h3>\r\n\r\n<p>Orders will be sent to the address as stated at the time of ordering process. Orders will be shipped on approved delivery date at time of purchasing. If there is any delay in delivery, you will be informed/contacted further. Delivery man will contact you before delivering the order to the destination address. It also aims to confirm the process of receiving orders at that time.</p>\r\n\r\n<p>If you are not in a place where the address of the order is addressed, you are required to provide an alternative acceptance order at the time and address in accordance with predetermined.</p>\r\n\r\n<h3>PAYMENT</h3>\r\n\r\n<p>Ganzberg Payments allows buyers and sellers to use various forms of payments on store.ganzberg.com and Ganzberg\'s apps and other services. Ganzberg users can pay with and accept payment by Wing, TrueMoney, Ganzberg gift card, some bank transfer services, and the sell at Ganzberg are all in local currencies.</p>\r\n', 'en', 1, NULL, NULL),
